// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./MintableSoul.sol";
import "./interfaces/ISoulMarket.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";

contract SoulMarket is MintableSoul, ISoulMarket {
    mapping(uint256 => Sale) private _onSale;

    event SoulOnSale(address indexed seller, uint256 price);
    event SoulBuyed(address indexed buyer, uint256 soulId, uint256 price);
    event SaleStoped(uint256 soulId);
    event SellerChanged(
        address indexed oldSeller,
        address indexed newSeller,
        uint256 soulId
    );
    event BuyerChanged(
        address indexed oldBuyer,
        address indexed newBuyer,
        uint256 soulId
    );

    function sale(uint256 soulId, uint256 price) public {
        require(carrierOf(soulId) == tx.origin, "You are not owner!");
        require(!_onSale[soulId].onSale, "Sale is opened!");
        _onSale[soulId] = Sale(
            block.timestamp,
            tx.origin,
            address(0),
            price,
            true
        );
        emit SoulOnSale(tx.origin, price);
    }

    function buy(uint256 soulId) public payable {
        require(_exists(soulId), "Soul doesn'y exist");
        require(carrierOf(soulId) != tx.origin, "You are owner!");
        require(_onSale[soulId].onSale, "Soul not for sale");
        require(msg.value >= _onSale[soulId].price, "Not enough value");
        require(hasSoul(tx.origin), "You should have a soul");
        // require(ownerOf(soulId) != msg.sender);

        // uint256 buyerSoul = getSoul(msg.sender);

        Sale memory sale1 = getInfoAboutSale(soulId);
        // uint256 currentPrice = sale.price;

        uint256 sendBack = msg.value - sale1.price;
        // todo tx.gasprice ?
        if (sendBack > 0) {
            payable(address(tx.origin)).transfer(sendBack);
        }

        payable(address(_onSale[soulId].seller)).transfer(msg.value - sendBack);

        changeCarrier(soulId, tx.origin); // after test to _changeCarrier
        _changeBuyer(soulId, tx.origin);
        _stopSale(soulId);

        emit SoulBuyed(tx.origin, soulId, msg.value);
    }

    function _stopSale(uint256 soulId) internal {
        _onSale[soulId].onSale = false;
        emit SaleStoped(soulId);
    }

    function stopSale(uint256 soulId) public {
        require(carrierOf(soulId) == msg.sender);
        _stopSale(soulId);
    }

    function _changeSeller(uint256 soulId, address newSellerAddress) internal {
        // require(condition);
        _onSale[soulId].seller = newSellerAddress;
        emit SellerChanged(tx.origin, newSellerAddress, soulId);
    }

    function changeSeller(uint256 soulId, address newSellerAddress) public {
        _changeSeller(soulId, newSellerAddress);
    }

    function _changeBuyer(uint256 soulId, address newBuyerAddress) internal {
        // require(condition);
        _onSale[soulId].buyer = newBuyerAddress;
        emit BuyerChanged(tx.origin, newBuyerAddress, soulId);
    }

    function getInfoAboutSale(uint256 soulId)
        public
        view
        returns (Sale memory)
    {
        return _onSale[soulId];
    }
}
